import React from "react";
import "./Header.css";
import PageviewTwoToneIcon from '@mui/icons-material/PageviewTwoTone';
import SettingsApplicationsTwoToneIcon from '@mui/icons-material/SettingsApplicationsTwoTone';
import CircleNotificationsTwoToneIcon from '@mui/icons-material/CircleNotificationsTwoTone';
import Avatar from '@mui/material/Avatar';

function Header() {
  return (
    <div className="header">
      <div className="header-left">
        <img src="https://cdn-icons-png.flaticon.com/512/708/708746.png" alt="" />
        <h3 className="logo">MP Studio</h3>
      </div>
      <div className="header-input">
        <input type="text" />
        <PageviewTwoToneIcon />
        <SettingsApplicationsTwoToneIcon />
        <CircleNotificationsTwoToneIcon />
        <Avatar alt="Avatar" src="https://lh3.googleusercontent.com/YADhOQnMujKLgWfG1hx6svDopY7Ddm4WbZmplk8iIymo8tnfshXGk_fbIkTVvCOOB1xrNpkUjy-A-Hg7Y3UYA-s96Elk_rwINgtfLCqDOVZMK_Y8bQFypW4UqU_vEuDnbmrdggCwVS3cWR-EDImS-SJJuWRE3iAkNWRTVh7X2bqSjqHYB-3PK8o5hkc7sKJ7ogH8sbiQXp9AwxJtktjcsAQOhwKaPRYq3CxKD3pDanXpPxF2OwuqYkY6Y-OOQ6iC_THeZLNjBgnmslooH_-CTyJM7EQ-62Oc8PQakoG5IcjldUmexxtlKu6rRJKqdu1PAMEHiySja4HDI70Ceh9UBBGnDX0d-BdiatZZOxXVrkQh4Q7zhnihtDQsRcL2M9ajmYndcvv9uG3H-PiTxXwKi8JeOwdT5_0En2uTwEyvq3jX9oxNHVOtlbxrWK5uAequZR4U_A4gydsfaxvhz4IxTtRA1OKXUWh-SbL2D_fsN9S-HIhmy-2N07zebkCW8KFgAAnvPz1dRE-osHZpq0DcxJ0AezgvcpOAA-s9IIvFCKfAeU6zxGSyn53wNp1SYiOhs9Ha2YT9qYcjwhj2NbjUc0D7i9oXZpuOmOgvqXLkkrAjqkBvMAmW_jbSsDKeArS89Nem3FWM47Tq2QcCNsV310KxWmwf8NExr1q_x0m-aPmCq7SdyDclDMGvH0IrBdOkM7pMW1WsJZlgK5as6ll07co=w276-h275-no?authuser=0" />
      </div>
      <div className="header-right"></div>
    </div>
  );
}

export default Header;
